import React from 'react';
import { Grid, Box } from 'theme-ui'
import './App.css';
import spacings from './spacings.json'

function App() {
  console.log(spacings);

  const sites = Object.keys(spacings).filter(site => spacings[site].length);

  console.log((sites.length * .25))

  return (
    <div className="App">
      <Grid width={1}>
        {sites.map((s) => (
          <Box key={s} width={`${(sites.length * .25)}%`}>
            <span>{s}</span>
          </Box>
        ))}
      </Grid>



    </div>
  );
}

export default App;
